import useSWR from 'swr';
import './App.css';

const fetcher = (url: string) => fetch(url).then((res) => res.json());
type Item = {
    id: number;
    title: string;
    body: string;
    done: boolean;
};

function App() {
    const { data, error } = useSWR('http://localhost:4000/api/todos', fetcher);

    console.log('data', data);

    return (
        <div className="App">
            <h1> Guide to getting things done. </h1>
            {data?.length > 0 ? (
                data.map((item: Item) => (
                    <>
                        <h4> {item.title} </h4>
                        <p> {item.body} </p>
                    </>
                ))
            ) : (
                <p> No action items yet. </p>
            )}
        </div>
    );
}

export default App;
